import React, { Component } from "react";
import SavedDogsCard from '../Containers/SavedDogsCard'
import Navbar from "./Navbar"

export default class UserHomePage extends Component {

    render() {
        return (
            <div>

                <div>
                <Navbar UserNavbar={UserHomePage}/>
                <p>{this.props.currentLogin.name}</p>
                <div id="flex-inline-block">
                    <div class="saved-dogs">
                        <h1>saved dogs</h1>
                        {this.props.currentLogin.pets.map(dog =><SavedDogsCard dog={dog} key={dog.id}/>)}
                    </div>

                    <div class="float-child">
                    <h1>view requests</h1>
                    </div>
                </div>


            </div>



            </div>
        )
    }
}
